window.bookSummaryJSON = "<p>An indentured human woman. An Imperial man on a mission. A fake marriage born in the stars.</p> <p>When my master died, I believed I’d be set free.</p> <p>Instead, I’m sent to a temple where I’m forced to continue doing the one thing I know—pleasing alien males.</p> <p>Until Gael the Returner arrives.</p> <p>Half-human and half-Imperial, he travels the galaxy, rescuing humans.</p> <p>But instead of offering me my freedom, he has other plans.</p> <p>He needs me to spy for him, then he swears he will set me free.</p> <p>I just need to marry him first.</p> <p>What starts as a marriage of convenience to the most dangerous criminal in the sector becomes something more.</p> <p>Everything I do is for him.</p> <p>But after the life I’ve led, my complicated past, so much stands in our way.</p> <p>I thought Gael would give me freedom, instead, he’s entrapped my heart with no means of escape.</p> <p>One-click this thrilling, dark, and intense sci-fi romance filled with morally grey characters, damsel in distress, and a fake marriage that leads friends to become lovers, despite the complications it brings.</p>"; 
